s = tf('s');
n=10000;
f=logspace(0,10,n);
w=f*2*pi;

w_targ=2*pi*10^8;

%%
%[text] Frequency discriminator model
Plaser=10e-3/10; %from HHI manual 10% tap

R=0.8;%A/W %from HHI manual

slope=Plaser*0.1555/68.5e6/R %W/Hz from PDH matlab script %[output:33c3c231]
delay=10e-3/(3e8)*4;%8mm chip



fsr=5e9;%need to look deeper at this, what delay does a ring have? I don't think it has any, still need to check the frequency notch

O=slope*exp(-s*delay);%W/Hz

%there is a null at the fsr, as long as the ring is not super long we are at the first null so we're fine 
So=TRN(f);

bode(O,w) %[output:637a3a0d]
title('frequency discriminator + optical delay') %[output:637a3a0d]
ax = findall(gcf, 'Type', 'axes');

ylim(ax(1), [20*log10(abs(freqresp(O,10)))-10 20*log10(abs(freqresp(O,10)))+10]);    %[output:637a3a0d]
ylim(ax(2), [-180 0]);  %[output:637a3a0d]
angle(freqresp(O,w_targ))*180/pi %[output:8461a21c]


%%
%[text] Tia model
gain=123e3; %ohms from Ben

T=gain*R/(1+s/1e9/2/pi);% V/W
bode(T,w) %[output:4b759017]
title("TIA response") %[output:4b759017]
ax = findall(gcf, 'Type', 'axes');

ylim(ax(1), [20*log10(abs(freqresp(T,10)))-10 20*log10(abs(freqresp(T,10)))+10]);    %[output:4b759017]
ylim(ax(2), [-180 0]);  %[output:4b759017]
angle(freqresp(T,w_targ))*180/pi %[output:619d9d20]

%tia noise
St=(3.4e-12+4e-12)^2;%pA/vhz TIA+shot noise %paper has more accurate noise model

%%
%[text] Electronic model
delay=1.0e-9%electronic delay 1ns %[output:3d8a43fc]
E=exp(-s*delay)/(1+s/2e7/2/pi)%filtering %[output:07a995ad]
bode(E,w) %[output:87ecba76]
title("electronic filtering and delay") %[output:87ecba76]
ax = findall(gcf, 'Type', 'axes');

ylim(ax(1), [20*log10(abs(freqresp(E,10)))-30 20*log10(abs(freqresp(E,10)))+10]);    %[output:87ecba76]
ylim(ax(2), [-180 0]);  %[output:87ecba76]
angle(freqresp(E,w_targ))*180/pi %[output:8800ae87]
%[text] 
%[text] controller model
Kp=0.05; %10^(-2.4/10);
Ki=100;
Kii=0;
Kd=0;

C = Kp + Kii/s/s+Ki/s + Kd*s; % PID controller 

C=C*2e-3%/(1+s/1e9/2/pi)%laser current driver A/V %[output:7bb25c68]


bode(C,w) %[output:7af1da7d]
title('controller') %[output:7af1da7d]
%add some compensators here
%%
%[text] Laser model
L=frd(laserTF(f,1.6e8,5),f,'Units','Hz');%paper says b=2, this doesn't seem reasonable

L=17e9/0.01*(6.28e11)^2/(s^2+3.06e9*s+(6.28e11)^2) %Hz/A %[output:440835a6]

bode(L,w) %[output:64922e04]
L=frd(L,f,'Units','Hz');

Data = readtable('Teraxion\LMX-S_Standard_FN_PSD.csv'); %[output:73618f5f]
LMXS_Data = table2array(Data);
freq_LMXS = LMXS_Data(1:end,1);
FN_PSD_LMXS = LMXS_Data(1:end,2)*18;%1MHz linewidth



Sl=interp1(freq_LMXS, FN_PSD_LMXS, f, 'linear', 'extrap');


loglog(freq_LMXS,FN_PSD_LMXS,'X')
hold on
loglog(f,Sl)

legend('data','interpolated')
hold off

bode(L,w)
title('laser model')
%%
%[text] stability
bode(O*T*E*C*L,w)

ax = findall(gcf, 'Type', 'axes');

ylim(ax(1), [20*log10(abs(freqresp(O*T*E*C*L,10)))-300 20*log10(abs(freqresp(O*T*E*C*L,10)*10))]);   
ylim(ax(2), [-180 0]); 


title('open-loop gain')


nyquist(O*T*E*C*L)
%xlim([-2,5])
%ylim([-5,5])


[GM, PM, Wcg, Wcp] = margin(O*T*E*C*L)
disp(['Gain Margin: ', num2str(20*log10(GM)), ' dB']);
disp(['Phase Margin: ', num2str(PM), ' degrees']);




%[text] ELEC noise
H=T*E*C*L/(O*T*E*C*L+1);

[mag, ~] = bode(H); % Magnitude response of H(jω)

mag = squeeze(mag); % Reshape for compatibility

S_elec = transpose(mag.^2) .* St; % 
bodeplot(H)
ax = findall(gcf, 'Type', 'axes');

ylim(ax(1), [20*log10(abs(freqresp(H,10))/10) 20*log10(abs(freqresp(H,10)*10))]);   
ylim(ax(2), [-180 50]);  
title('electronic noise transfer function')





%[text] TRN noise

H=O*T*E*C*L/(O*T*E*C*L+1);
[mag, ~] = bode(H); % Magnitude response of H(jω)
mag = squeeze(mag); % Reshape for compatibility

S_TRN=transpose(mag.^2) .* So;

loglog(f, So, 'g-', 'LineWidth', 1.5);


%[text] laser noise

H = feedback(1, O*T*E*C*L,-1); % Closed-loop transfer function

[mag, ~] = bode(H); % Magnitude response of H(jω)
mag = squeeze(mag); % Reshape for compatibility
S_out = transpose(mag.^2) .* Sl+S_TRN+S_elec; % Output PSD

DCgain=10*log10(mag(1)^-2)

%[text] 
loglog(f, Sl, 'b-', 'LineWidth', 1.5); hold on;
loglog(f, S_out, 'r-', 'LineWidth', 1.5);
loglog(f, So, 'g-', 'LineWidth', 1.5);
loglog(f,8*log(2)/pi/pi*f,'y--', 'LineWidth', 1)
%loglog(f, S_elec, 'r-', 'LineWidth', 1.5);

grid on;
xlabel('Frequency (Hz)');
ylim([10^-1,10^11]);
xlim([1,10^10])
ylabel('PSD (Hz^2/Hz)');
legend('laser PSD', 'Output PSD','ring TRN','beta line'); %,'electronic noise');%,'electronic noise'
title('Input and Output Noise PSD');
hold off

legend(["laser PSD", "Output PSD", "ring TRN", "beta line"], "Position", [0.1872 0.7038 0.2411, 0.1810])
bandwidth=-1;

for k = 1:n
    if(S_out(k)>Sl(k)) 
        bandwidth=f(k)
        break;
    end

end
%[text] 
[f_ul, spectrum_ul, FWHM_approx_ul, FWHM_ul] =lineshape_num_v4(Sl, f, 1, 1, 2e6, 14);
FWHM_ul
[f_l, spectrum_l, FWHM_approx_ul, FWHM_l] =lineshape_num_v4(S_out, f, 1, 1, 2e6, 15);
FWHM_l
%%
% 
% plot(f_ul/10^6,abs(spectrum_ul),f_l/10^6,abs(spectrum_l))
% title('Teraxion Laser Lineshape')
% legend('unlocked','locked')
% xlabel('Frequency (MHz)')
% ylabel('Intensity (S_E(f))')

plot(f_ul/10^6,10*log10(abs(spectrum_ul)),f_l/10^6,10*log10(abs(spectrum_l)))
title('DFB Laser Lineshape')
legend('unlocked','locked')
xlabel('Frequency (MHz)')
ylabel('Intensity (S_E(f))')
